const generateHTMLContent = ({ salesData, totalGrossSales, expensesData, totalExpensesData, dateRange}) => {
    const netSales = totalGrossSales - totalExpensesData;
    const formatCurrency = (value) =>
      new Intl.NumberFormat('en-PH', { style: 'currency', currency: 'PHP', minimumFractionDigits: 0 }).format(value);
  
    return `
        <html>
            <head>
                <style>
                    body {
                        margin: 0px;
                    }

                    .report-container {
                        font-family: "Roboto", sans-serif;
                        font-weight: 300;
                        font-style: normal;
                        width: 100%;
                        height: 100%;
                    }

                    header {
                        display: flex;
                        gap: 24px;
                        background-color: #F1F2F6;
                        padding: 64px;
                    }

                    #branding-img {
                        height: 75;
                        width: 75;
                    }

                    .details {
                        display: flex;
                        flex-direction: column;
                        gap: 10px;
                    }

                    .details-title {
                        font-weight: bold;
                        font-size: 20px;
                    }

                    .details-minor {
                        font-size: 14px;
                    }

                    .report-type {
                        margin-left: auto;
                        display: flex;
                        flex-direction: column;
                        gap: 8px;
                        align-items: flex-end;
                    }

                    .report-date {
                        font-size: 12px;
                    }

                    .selected-report-type {
                        font-weight: bold;
                        font-size: 32px;
                    }

                    main {
                        padding: 32px 64px;
                    }

                    .table-container {
                        display: flex;
                        gap: 64px;
                        width: 100%;
                    }

                    .tbl-sales, .tbl-reports {
                        display: flex;
                        flex-direction: column;
                        width: 50%;
                        gap: 12px;
                    }

                    .tbl-title {
                        font-weight: bold;
                        font-size: 32px;
                        color: #231F20;
                    }

                    th {
                        color: rgba(35, 31, 32, 0.5);
                        font-weight: 300;
                    }

                    td {
                        color: rgba(35, 31, 32, 0.8);
                        padding: 20px 16px;
                        font-size: 12px;
                    }

                    tr:nth-child(odd) { 
                        background-color: #F8F8F8;
                    }

                    td, th {
                        text-align: left;
                    }

                    table {
                        width: 100%;
                        border-collapse: collapse;
                    }

                    .total-expenses {
                        align-self: flex-end;
                    }

                    .total-expenses-label {
                        color: #B64D49;
                        font-size: 14px;
                    }

                    .total-expenses-price {
                        color: #B64D49;
                        font-weight: bold;
                        font-size: 16px;
                    }

                    .total-gross {
                        align-self: flex-end;
                    }

                    .total-gross-label {
                        color: #17588E;
                        font-size: 14px;
                    }

                    .total-gross-price {
                        color: #17588E;
                        font-weight: bold;
                        font-size: 16px;
                    }

                    .total-net-sales {
                        font-size: 17;
                    }

                    .total-net-price {
                        color: #17588E;
                        font-weight: bold;
                    }
                    .total-net-price-negative {
                        color: #B64D49;
                        font-weight: bold;
                    }
                </style>
                <link rel="preconnect" href="https://fonts.googleapis.com">
                <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
                <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,900;1,100;1,200&family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap" rel="stylesheet">
            </head>
            <body>
                <div class="report-container">
                    <header>
                        <img id="branding-img" src='data:image/png;base64,'/>
                        <div class="details">
                            <div class="details-title">Laun-dry Master</div>
                            <div class="details-minor">sales@laundrymaster.com</div>
                            <div class="details-minor">0968 658 2788</div>
                            <div class="details-minor">www.laundrymaster.com</div>
                        </div>
                        <div class="report-type">
                            <div class="report-date">${dateRange}</div>
                            <div class="selected-report-type">Financial Report</div>
                            <div class="total-net-sales"> 
                                Total Net Sales:
                                <span 
                                   class="${netSales < 0 
                                        ? "total-net-price-negative" 
                                        : "total-net-price"}"
                                    >
                                    ${formatCurrency(netSales)}
                                </span>
                            </div>
                        </div>
                    </header>
                    <main>
                        <div class="table-container">
                            <div class="tbl-sales">
                                <span class="tbl-title">Sales</span>
                                <table>
                                    ${salesData.map(
                                    sale => `
                                        <tr>
                                            <td>${sale.description}</td>
                                            <td>${sale.quantity}x</td>
                                            <td>${formatCurrency(sale.price)}</td>
                                            <td>${formatCurrency(sale.subTotal)}</td>
                                        </tr>
                                    `
                                    ).join('')}
                                </table>
                                <span class="total-gross">
                                    <span class="total-gross-label">Total Gross Sales:</span>
                                    <span class="total-gross-price">${formatCurrency(totalGrossSales)}</span>
                                </span> 
                            </div>
                            <div class="tbl-reports">
                                <span class="tbl-title">Expenses</span>
                                <table>
                                    ${expensesData.map(
                                    expense => `
                                        <tr>
                                            <td>${expense.date}</td>
                                            <td>${expense.category}</td>
                                            <td>${expense.description}</td>
                                            <td>${formatCurrency(expense.price)}</td>
                                        </tr>
                                    `
                                    ).join('')}
                                </table>
                                <span class="total-expenses">
                                    <span class="total-expenses-label">Total Expenses:</span>
                                    <span class="total-expenses-price">${formatCurrency(totalExpensesData)}</span>
                                </span> 
                            </div>
                        </div>
                    </main>
                </div>
            </body>
        </html>
    `
}

module.exports = { generateHTMLContent };
